svg.script:
// 
var svg = document.getElementsByTagName('svg')[0];
function getMousePosition(evt) {
   var CTM = svg.getScreenCTM();
   return {
      x: (evt.clientX - CTM.e) / CTM.a,
      y: (evt.clientY - CTM.f) / CTM.d
   };
}
area = svg.getElementById('area');
clippingRectangle = svg.getElementById('clippingRectangle');
var translate = svg.createSVGTransform();
translate.setTranslate(0,0);
area.transform.baseVal.insertItemBefore(translate,0);
clippingRectangle.transform.baseVal.appendItem(translate);
dragging = false;
var offset;
var transform = area.transform.baseVal.getItem(0);
var transform_clipping = clippingRectangle.transform.baseVal.getItem(2);

var xlabels = svg.getElementsByClassName('xlabel');
for (var i = 0; i<xlabels.length; ++i) {
   xlabels[i].setAttribute('data-value',parseFloat(xlabels[i].innerHTML));
}
var ylabels = svg.getElementsByClassName('ylabel');
for (var i = 0; i<xlabels.length; ++i) {
   ylabels[i].setAttribute('data-value',parseFloat(ylabels[i].innerHTML));
}

scale = {
	x: area.transform.baseVal.getItem(1).matrix.a,
	y: area.transform.baseVal.getItem(1).matrix.d
};



function startDrag(evt) {
   dragging = true;

   offset = getMousePosition(evt);
   offset.x -= transform.matrix.e;
   offset.y -= transform.matrix.f;

	scale = {
		x: area.transform.baseVal.getItem(1).matrix.a,
		y: area.transform.baseVal.getItem(1).matrix.d
	};

}

function drag(evt) {
   if (dragging) {
      evt.preventDefault();
      var coord = getMousePosition(evt);
      transform.setTranslate(coord.x - offset.x, coord.y - offset.y);
      transform_clipping.setTranslate(- coord.x + offset.x, - coord.y + offset.y);
      for (var i = 0; i<xlabels.length; ++i) {
           var value = parseFloat(xlabels[i].getAttribute('data-value'));
	   xlabels[i].innerHTML = (value + (coord.x - offset.x)/scale.x).toFixed(2).toString()
      }
      for (var i = 0; i<ylabels.length; ++i) {
           var value = parseFloat(ylabels[i].getAttribute('data-value'));
	   ylabels[i].innerHTML = (value + (coord.y - offset.y)/scale.y).toFixed(2).toString()
      }

   }
}

function endDrag(evt) {
   dragging = false;
}

area.addEventListener('mousedown', startDrag);
area.addEventListener('mousemove', drag);
area.addEventListener('mouseup', endDrag);
area.addEventListener('mouseleave', endDrag);
   //
